css:
@-moz-document domain("tineye.com") {
/* Header background */
header {
    clear: both;
    height: 80px;
    width: 100%;
    background-color: #000;
}

/*Query Summary background*/
.query-summary {
    background-color: #060606;
    border-bottom: 1px solid #686868;
    font-size: 13px;
    color: #1c5293;
}

/* Main Body */
body {

    color: #acacac;
    background: #000;
}

.results .match h4 a {
    color: #9d9d9d;
}


.products {
    background-color: #060606;
}


/* Text Related */
h1, h2, h3, h4, h5, h6 {
    color: #515559;
    letter-spacing: 0;
}

p,
p.md,
p.sm {
    color: #686868;
}

label {
    color: #515559;
}
}
